                                /> 
                                <div className="info" /*onClick={e => linkToPermit()}*/>
                                {/* How to make div clickable?
                                <Link href="www.google.com"></Link> */}
                                <h5 className='name text-light'>{value.org_name} | {value.name}</h5>    
                                <h5 className='name text-light'>{value.entrance_name}</h5>    
                                <h5 className='name text-light'>{value.city}, {value.town}</h5>    
                                <h5 className='name text-light'>Permits Available: {value.count}</h5>    
                            </div>   
                            </a>             
                        </div>
                        {/* <div className="item">
                            <span>{value.count}</span>
                        </div> */}
                    </div>
                    )
                )
            }
        </>


